import styled from 'styled-components';

const ArchivesContainer = styled.div`
  max-width: 800px;
  margin: 0 auto;
  padding: 2rem;
`;

function Archives() {
  return (
    <ArchivesContainer>
      <h1>文章归档</h1>
      <div>
        <h2>2024年</h2>
        <ul>
          <li>2024-03 - 示例文章标题</li>
          <li>2024-02 - 另一篇文章</li>
        </ul>
        <h2>2023年</h2>
        <ul>
          <li>2023-12 - 往年文章</li>
        </ul>
      </div>
    </ArchivesContainer>
  );
}

export default Archives;
